  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Bear River Migratory
  Bird Refuge outlines Refuge accomplishments from May through August of 1942. The
  report begins by summarizing the weather conditions and water conditions during
  this period. Wildlife- including migratory birds, upland game birds, furbearers,
  predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
  and maintenance section discusses physical developments, plantings, and wildfires.
  The public relations section of the report describes recreational uses, Refuge visitors,
  and violations. N-R forms and photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
